// importing components
import Header from "../components/Header";
import RegisterAd from "../components/RegisterAd";
import FriendlyAd from "../components/FriendlyAd";
import YelpComp from "../components/yelpComponent";

const LandingPage = ({ Paths, yelpData }) => {
  const landingStyles = {
    backgroundImage: "url('./images/bgImg.jpeg')",
  };
  return (
    <div className="landing-page" style={landingStyles}>
      <Header Paths={Paths} />
      <div className="page-top grid grid-cols-3 gap-4">
        <RegisterAd />
        <FriendlyAd />
      </div>
      <div className="page-mid">
        <YelpComp yelpData={yelpData} />
      </div>
    </div>
  );
};

export default LandingPage;
